import TaskHeader from "./components/TaskHeader/TaskHeader";
import Tasks from "./components/Tasks/Tasks";


function App() {
  return (
  <div className="Topbar">
    
    {/* Code Here */}
    <span> Todo List</span>
  
    <AddTask />
    <Counter />
    <Task />
    <TaskHeader />
    <Tasks />
  
  
  </div>
  ) ;
}

export default App;
